new FluentWait<>(driver)
                .withTimeout(Duration.ofSeconds(15))
                .pollingEvery(Duration.ofMillis(500))
                .until(webdriver -> {
                    try {
                        card = client.cardsService.getCard(card.id).execute().body();
                        return !Objects.isNull(card);
                    } catch (IOException ex) {
                        ex.printStackTrace();
                        return false;
                    }
                });

